class Card::MemgenContext < ActiveInteractor::Context::Base
  attributes :matchups
  attribute :block, default: -> { [] }

  validates :matchups, presence: true
end

class Card::Memgen < ActiveInteractor::Base
  delegate :matchups, :block, to: :context

  def perform
    serialize_header!
    serialize_matches!
    serialize_blanks!
  end

  private

    def serialize_header!
      block << ''
    end

    def serialize_matches!
      matchups.each do |data|
        block << Match::Memgen.perform(
          team_a: data[:team_a],
          team_b: data[:team_b],
          title: data[:title]
        ).block.join
      end
    end

    def serialize_blanks!
      (15 - matchups.length).times do
        block << ''
      end
    end
end
